window.bookSummaryJSON = "<p>To protect his ward Ciri, Geralt of Rivia sends her to train with the sorceress Yennefer. But all is not well within the Wizard's Guild in the second novel of the Witcher, Andrzej Sapkowski's groundbreaking epic fantasy series that inspired the hit Netflix show and the blockbuster video games.</p> <p>Geralt is a Witcher: Guardian of the innocent, protector of those in need, a defender in dark times against some of the most frightening creatures of myth and legend.</p> <p>His task now is to protect Ciri. A child of prophecy, she will have the power to change the world for good or for ill - but only if she lives to use it.</p> <p>Witcher collections:</p> <p></p> <ul> <li><i>The Last Wish</i></li> <li><i>Sword of Destiny</i>&nbsp;</li> </ul> <p>Witcher novels:</p> <p></p> <ul> <li><i>Blood of Elves</i></li> <li><i>The Time of Contempt</i></li> <li><i>Baptism of Fire</i></li> <li><i>The Tower of Swallows</i></li> <li><i>Lady of the Lake</i></li> <li><i>Season of Storms</i>&nbsp;</li> </ul> <p>Hussite Trilogy:</p> <p></p> <ul> <li><i>The Tower of Fools</i></li> <li><i>Warriors of God</i></li> </ul> <p>Translated from original Polish by David French.</p>"; 
